import './App.css'

function App() {
  return (
    <div className="App">

        <form >
            <input type='file' multiple id='fileUpload' />
            <label htmlFor='fileUpload'>
                <button className="btn btn-primary">Upload Files</button>
            </label>
        </form>
    </div>
  );
}

export default App;
